import React from 'react';

function List() {
    return (
        <ol>
            <li>Mothi Aai</li>
            <li>Bapu</li>
            <li>Nanda Aai</li>
            <li>Suchit Mama</li>
            <li>Sameer Dada</li>
            <li>Paramatma</li>
            <li>Trivikram</li>
            <li>Pradnya</li>
        </ol>
    );
}

export default List;
